                });
                for (File dir : dirs) {
                    int lastIndex = dir.toString().lastIndexOf(separatorChar) + 1;
                    String partTitle = dir.toString().substring(lastIndex, dir.toString().length());
                    registerModule(readMFProductTitle(root + "") + "-" + partTitle, readMFVersion(root + ""));
